import { gql } from "@apollo/client";

export const CREATE_USER = gql`
    mutation createUser(
            $username: String!
            $email: String!
            $password: String!
            $firstName: String
            $lastName: String
        ) {
            register(
                firstName: $firstName
                lastName: $lastName
                username: $username
                password: $password
                email: $email
            ) {
                id
                username
                lastName
                firstName
                created
                email
            }
        }

`;

export const CREATE_REVIEW = gql`
    mutation createReview(
        $description: String!
        $movieId: Int!
        $authorId: String!
        $rating: Int!
    ) {
        createReview(
            description: $description
            movieId: $movieId
            authorId: $authorId
            rating: $rating
        ) {
            description
            created
            movieId
            authorId
            rating
        }
    }
`;
